import React from "react";
import logo from "./logo.svg";
import "./App.css";

import "./components/BioHeader";
import BioHeader from "./components/BioHeader";
import Project from "./components/Project";

function App() {
  return (
    <div className="App">
      <BioHeader></BioHeader>
      <div>
        <Project></Project>
      </div>
    </div>
  );
}

export default App;
